import { defineStore } from "pinia";
import { getMutables } from "@/composables/getMutables";

export const usePosts = defineStore("posts", {
  state: () => {
    return { posts: null };
  },
  actions: {
    async getPosts() {
      const posts = await getBlogPosts();
      console.log(posts);
    },
  },
});
